import React from "react";
import Layout from "../../components/layout";
import styles from "./style.module.css";
import ChangeImage from "../../assets/image/Screenshot_2023-05-13-15-00-01-730_com.whatsapp.jpg";

const SettingsPage = () => {
  return (
    <Layout>
      <div className={styles.SettingsPage}>
        <div className={styles.Left}>
          <span>Ayarlar</span>
          <span className={styles.ProfilSettings}>Profil ayarları</span>
          <span className={styles.AccountSettings}>Hesap ayarları</span>
          <span className={styles.Exit}>Çıkış yap </span>
        </div>
        <div className={styles.Right}>
          <div className={styles.ProfileSettingsBox}>
            <span>Profil Ayarları </span>
            <img className={styles.ImageChange} src={ChangeImage} alt="" />
            <div>
              <span>Profili Sil</span>
              <span>Profili Değiştir</span>
            </div>

            <div>
              <input type="text" />
              <input type="text" />
            </div>
          </div>

          <div className={styles.AccountSettingsBox}>
            <div>
              {" "}
              <span>mail değiştir</span> <input type="text" />{" "}
            </div>
            <div>
              {" "}
              <span>şifre değiştir</span> <input type="text" />{" "}
            </div>
          </div>
        </div>
      </div>
    </Layout>
  );
};

export default SettingsPage;
